// src/api.js
const fetchAlbumById = async (albumId) => {
  try {
    const response = await fetch(`http://localhost:3001/api/albums/${"65d481e806c33b36005820f0"}`);

    if (!response.ok) {
      throw new Error(`Failed to fetch album: ${response.status} ${response.statusText}`);
    }

    const albumData = await response.json();
    return albumData;
  } catch (error) {
    console.error('Error fetching album:', error);
    throw error; // Re-throw the error to be handled by the calling code
  }
};

export default fetchAlbumById;
